import React from 'react'
import {CustomInput,Button} from 'reactstrap'
let Rowview=({todo,toggleSelect,toggleComplete})=>{
    return(
        <div>
            <tr>
                <td>
                <CustomInput
                type='checkbox'
                id={todo.id}
                checked={todo.isSelect}
                onChange={()=>{toggleSelect(todo.id)}}
                />
                </td>
                <td>
                    {todo.time.toDateString()}
                </td>
                <td>
                <Button className='ml-auto' color={todo.isCompelete ? 'success': 'danger'} onClick={()=>toggleComplete(todo.id)}>{toggleComplete?'stop':'running'}</Button>
                </td>
            </tr>
        </div>
    )
}


let TableView=({todo,toggleSelect,toggleComplete})=>(
    <table>
        <thead>
            <th>#</th>
            <th>Time</th>
            <th>Todo</th>
            <th>Action</th>
        </thead>
   
    </table>
)
export default TableView;
